// para navegar no header
import { Link } from 'react-router-dom' ;

// import './style.css';
import logo_joao from './img/logo3.png';
import { render } from 'react-dom';


function Header(){    
    return(
    //    <header class="sticky-top">
    //         <img src={logo_joao}/>
    //         <div className='menu_header'>
    //             <Link to="/"> <strong>Home</strong></Link>
    //             <Link to="/sobre"> <strong>Sobre</strong></Link>        
    //             <Link to="/projeto"> <strong>Projetos</strong></Link>                    
    //             <Link to="/contato"><strong>Contato</strong></Link>            
    //         </div>
    //    </header>
    <header>        
        <nav class="navbar navbar-expand-sm navbar-light">
            <div class="container">
                <a href="#" class="navbar-brand">
                    <img src={logo_joao}/>
                </a>

                <button class="navbar-toggler" data-toggle="collapse" data-target="#nav-principal">
                  <span class="navbar-toggler-icon"></span>
                </button>

                <div class="collapse navbar-collapse" id="nav-principal">
                    <ul class="navbar-nav ml-auto">
                        <li class="nav-item">
                            <Link to="/" class="nav-link"> <strong>Home</strong></Link>
                        </li>
                        <li class="nav-item">
                            <Link to="/sobre" class="nav-link"> <strong>Sobre</strong></Link>                              
                        </li>
                        <li class="nav-item">
                            <a href="#" class="nav-link">Benefícios</a>
                        </li>
                        <li class="nav-item">
                            <a href="#" class="nav-link">Preços</a>
                        </li>
                        <li class="nav-item">
                            <a href="#" class="btn btn-outline-light ml-4">Entrar</a>
                        </li>
                    </ul>
                </div>

            </div>
        </nav>
    </header>
       
    )
}


export default Header;
